// ES5以降で採用された、JSON.parse()を使うか、JSON.orgライブラリを使うこと
var jstr = '{\"mykey\": \"my value\"}';
var data = JSON.parse(jstr);

// あるいはjQueryなどのライブラリが用意した方法でもよい
var data = jQuery.parseJSON(jstr);

